import React from "react";
import styled from "styled-components";

export default function Navbar() {
  return (
    <MainContainer>
      <NavbarMainContainer>
        <LogoImg>
          <img
            src="/navbarimgcontainer/website_logo.png"
            alt="HouseHoldWebsite"
          />
        </LogoImg>
        <NavbarContent>
          <ul className="Navbar_ul">
            <div className="NavContentContainer">
              <a href="">
                <li className="Navbar_li">Maintainance</li>
              </a>
              <div className="InnerOptions">
                <li className="InnerOptions_li">Electrical supplies</li>
                <li className="InnerOptions_li">Water Supplies</li>
              </div>
            </div>

            <div className="NavContentContainer">
              {/* <li className="Navbar_li">HouseHold Things</li> */}
              <a href="">
                <li className="Navbar_li">HouseHold Things</li>
              </a>
              <div className="InnerOptions">
                <li className="InnerOptions_li">Electrical supplies</li>
                <li className="InnerOptions_li">Water Supplies</li>
              </div>
            </div>

            <div className="NavContentContainer">
              {/* <li className="Navbar_li">Medical Facilities</li> */}
              <a href="">
                <li className="Navbar_li">Medical Facilities</li>
              </a>
              <div className="InnerOptions">
                <li className="InnerOptions_li">Electrical supplies</li>
                <li className="InnerOptions_li">Water Supplies</li>
              </div>
            </div>

            <div className="NavContentContainer">
              {/* <li className="Navbar_li">About</li> */}
              <a href="">
                <li className="Navbar_li">About</li>
              </a>
              <div className="InnerOptions">
                <li className="InnerOptions_li">Electrical supplies</li>
                <li className="InnerOptions_li">Water Supplies</li>
              </div>
            </div>
          </ul>
        </NavbarContent>
      </NavbarMainContainer>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  width: 100%;
`;

const NavbarMainContainer = styled.nav`
  width: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
`;

const LogoImg = styled.div`
  width: 5%;
  padding: 4px;
  margin: 4px;

  img {
    width: 100%;
    filter: invert(100%);
  }
`;

const NavbarContent = styled.div`
  width: 100%;

  .Navbar_ul {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-evenly;
    list-style: none;

    .NavContentContainer {
      border: 2px solid purple;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      padding: 3px;
      margin: 5px;
      width: 100%;

      a {
        text-decoration: none;
        color: #472d2d;
        font-size: 1.2rem;
        padding: 2px;
        box-sizing: border-box;
        width: 100%;
        letter-spacing: 0.3px;

        .Navbar_li {
          font-family: "Alkatra", cursive;
          padding: 2px;
          margin: 2px;
          cursor: pointer;
          border-radius: 4px;
          text-align: center;
          background-color: white;
          width: 100%;
          box-sizing: border-box;
        }
      }

      /* css for inner option */

      .InnerOptions {
        border: 2px solid pink;
        display: none;
      }
      a:hover {
        .InnerOptions {
          display: block;
        }
      }
    }
  }
`;
